import React from 'react';
import {TextField, Grid, Stack} from '@mui/material'
import LoginForm from './LoginForm';
/**
 *  Login Main Component
 * 
 */

const Login = () => {
    return(
        <Grid container spacing={2}>
            <Grid item>
             <Stack
              alignContent={'center'}
              sx = {{padding : 6}}
              >
              <LoginForm />
             </Stack>

            </Grid>
        </Grid>
    );
}

export default Login;
